import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Grid, 
  Paper,
  useTheme,
  Link,
  CircularProgress,
  IconButton,
  Tooltip,
  Snackbar,
  Button
} from '@mui/material';
import OpenInNewIcon from '@mui/icons-material/OpenInNew';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import CancelIcon from '@mui/icons-material/Cancel';
import ContentCopyIcon from '@mui/icons-material/ContentCopy';
import TwitterIcon from '@mui/icons-material/Twitter';
import RefreshIcon from '@mui/icons-material/Refresh';
import { getPairXToken } from '../../utils/helpers';
import axios from 'axios';

const commonTypographyStyles = {
  sectionTitle: {
    variant: "subtitle2",
    color: "primary.main",
    mb: 1
  },
  label: {
    variant: "body2",
    color: "text.secondary"
  },
  value: {
    variant: "body2",
    fontWeight: 500
  },
  statBox: {
    p: 1.5,
    borderRadius: 1,
    bgcolor: 'action.selected',
    height: '100%'
  }
};

const TimeframeStats = ({ label, txns, volume, priceChange }) => {
  // Add null checks with default values
  const safeVolume = volume ?? 0;
  const safePriceChange = priceChange ?? 0;
  const safeTxns = txns ?? { buys: 0, sells: 0 };

  return (
    <Box sx={{ mb: 2 }}>
      <Typography variant="subtitle2" color="primary.main" gutterBottom>
        {label}
      </Typography>
      <Grid container spacing={2}>
        {/* Transactions */}
        <Grid item xs={12}>
          <Box sx={{ 
            display: 'flex', 
            justifyContent: 'space-between', 
            mb: 1,
            bgcolor: 'action.selected',
            p: 1,
            borderRadius: 1
          }}>
            <Box>
              <Typography color="text.secondary" variant="body2">Buys</Typography>
              <Typography 
                variant="body1" 
                color="success.main"
                sx={{ fontWeight: 500 }}
              >
                {safeTxns.buys}
              </Typography>
            </Box>
            <Box sx={{ textAlign: 'right' }}>
              <Typography color="text.secondary" variant="body2">Sells</Typography>
              <Typography 
                variant="body1" 
                color="error.main"
                sx={{ fontWeight: 500 }}
              >
                {safeTxns.sells}
              </Typography>
            </Box>
          </Box>
        </Grid>

        {/* Volume and Price Change */}
        <Grid item xs={12}>
          <Box sx={{ 
            display: 'flex', 
            justifyContent: 'space-between',
            bgcolor: 'action.selected',
            p: 1,
            borderRadius: 1
          }}>
            <Box>
              <Typography color="text.secondary" variant="body2">Volume</Typography>
              <Typography variant="body1" sx={{ fontWeight: 500 }}>
                ${Number(safeVolume).toLocaleString()}
              </Typography>
            </Box>
            <Box sx={{ textAlign: 'right' }}>
              <Typography color="text.secondary" variant="body2">Price Change</Typography>
              <Typography 
                variant="body1" 
                color={safePriceChange >= 0 ? 'success.main' : 'error.main'}
                sx={{ fontWeight: 500 }}
              >
                {safePriceChange >= 0 ? '+' : ''}{safePriceChange.toFixed(2)}%
              </Typography>
            </Box>
          </Box>
        </Grid>
      </Grid>
    </Box>
  );
};

const StatRow = ({ label, txns, volume, priceChange }) => {
  if (!txns || !volume) return null;

  const total = txns.buys + txns.sells;
  const buyPercent = (txns.buys / total) * 100;
  const sellPercent = (txns.sells / total) * 100;

  return (
    <Box sx={{ mb: 3 }}>
      <Box sx={{ 
        display: 'flex', 
        justifyContent: 'space-between',
        alignItems: 'center',
        mb: 1
      }}>
        <Typography variant="subtitle2" color="primary.main">
          {label}
        </Typography>
        <Box sx={{ 
          display: 'flex',
          alignItems: 'center',
          bgcolor: priceChange >= 0 ? 'success.main' : 'error.main',
          px: 1,
          py: 0.5,
          borderRadius: 1,
        }}>
          <Typography 
            variant="body2" 
            sx={{ 
              color: 'white',
              fontWeight: 500 
            }}
          >
            {priceChange >= 0 ? '+' : ''}{priceChange?.toFixed(2)}%
          </Typography>
        </Box>
      </Box>

      {/* Volume Row */}
      <Box sx={{ mb: 2 }}>
        <Box sx={{ 
          display: 'flex', 
          justifyContent: 'space-between',
          alignItems: 'center',
          mb: 0.5 
        }}>
          <Typography variant="body2" color="text.secondary">
            Volume
          </Typography>
          <Typography variant="body2">
            ${Number(volume).toLocaleString()}
          </Typography>
        </Box>

        <Box sx={{ 
          display: 'flex', 
          height: '24px',
          borderRadius: 1,
          overflow: 'hidden',
          bgcolor: 'background.paper',
          border: 1,
          borderColor: 'divider'
        }}>
          <Box sx={{ 
            width: `${54.95}%`,
            bgcolor: 'success.main',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}>
            <Typography 
              variant="caption" 
              sx={{ color: 'white', fontWeight: 500 }}
            >
              ${Number(volume * 0.5495).toLocaleString()}
            </Typography>
          </Box>
          <Box sx={{ 
            width: `${45.05}%`,
            bgcolor: 'error.main',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}>
            <Typography 
              variant="caption" 
              sx={{ color: 'white', fontWeight: 500 }}
            >
              ${Number(volume * 0.4505).toLocaleString()}
            </Typography>
          </Box>
        </Box>

        <Box sx={{ 
          display: 'flex', 
          justifyContent: 'space-between',
          mt: 0.5
        }}>
          <Typography variant="caption" color="success.main">
            54.95%
          </Typography>
          <Typography variant="caption" color="error.main">
            45.05%
          </Typography>
        </Box>
      </Box>

      {/* Transactions Row */}
      <Box>
        <Box sx={{ 
          display: 'flex', 
          justifyContent: 'space-between',
          alignItems: 'center',
          mb: 0.5 
        }}>
          <Typography variant="body2" color="text.secondary">
            Transactions
          </Typography>
          <Typography variant="body2">
            {total}
          </Typography>
        </Box>

        <Box sx={{ 
          display: 'flex', 
          height: '24px',
          borderRadius: 1,
          overflow: 'hidden',
          bgcolor: 'background.paper',
          border: 1,
          borderColor: 'divider'
        }}>
          <Box sx={{ 
            width: `${buyPercent}%`,
            bgcolor: 'success.main',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}>
            <Typography 
              variant="caption" 
              sx={{ color: 'white', fontWeight: 500 }}
            >
              {txns.buys}
